        flex-direction: column;

        border: none;
        background-color: white;

      // Mock HTTP request function
      async function fetchPdfAsBase64() {
        console.log("Starting PDF fetch request...");

        // Simulate 2-second delay
        await new Promise((resolve) => setTimeout(resolve, 2000));

        console.log("PDF fetch completed");
        return mockPdfData;
      }

      // Function to display PDF information
      function displayPdfInfo(pdfData) {
        const loadingIndicator = document.getElementById("loading-indicator");
        const pdfInfo = document.getElementById("pdf-info");
        const pdfIframe = document.getElementById("pdf-iframe");

        // Hide loading indicator
        loadingIndicator.style.display = "none";

        // Show PDF info
        pdfInfo.style.display = "block";

        // Set iframe source with base64 data
        const dataUrl = `data:${pdfData.contentType};base64,${pdfData.base64Data}`;
        pdfIframe.src = dataUrl;
      }

      // Initialize the page
      document.addEventListener("DOMContentLoaded", async function () {
        console.log("Page loaded, starting PDF fetch...");

        try {
          const pdfData = await fetchPdfAsBase64();
          displayPdfInfo(pdfData);
        } catch (error) {
          console.error("Error fetching PDF:", error);
          document.getElementById("loading-indicator").innerHTML =
            '<p style="color: red;">Error loading PDF file. Please try again.</p>';
        }
      });
